import React from 'react';
import { Navigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const PrivateRoute = ({ isAdminOnly, children }) => {
    const { user } = useAuth();

    console.log('PrivateRoute: User:', user); // Log the user object

    if (!user) {
        console.log('PrivateRoute: No user logged in. Redirecting to /login...');
        return <Navigate to="/login" />;
    }

    if (isAdminOnly && !user.isAdmin) {
        console.log('PrivateRoute: User is not an admin. Redirecting to /...');
        return <Navigate to="/" />;
    }

    console.log('PrivateRoute: Rendering protected component for user:', user.email);
    return children;
};

export default PrivateRoute;
